import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, id, question, questionId}){

    const q = id => {
        return getQuestionId(id);
    }

    console.log(q);         

    return(
        <Paper              
            key={index}
        >
            <h1>Detail's page</h1>  
            <p>{q.title}</p>


        </Paper>
    )
}

export default Question;
